(108, 488, 'Casetas', 228, '1', '1', 1, '0', 5, 'babypets', 'default_3x3', 'catalog_header_babybear', 'catalog_teaser_babybear', '', 'Necesitas un Nido de Cruce y dos Mascotas Adultas del mismo tipo para cruzarlas y conseguir Bebés Mascotas. Al menos una de las Mascotas Adultas debe ser tuya. El Nido de Cruce desaparece cuando se produce el cruce.', '', '', ''),
(109, 488, 'Comida para Mascotes', 201, '1', '1', 1, '0', 8, 'pet_accessories', 'default_3x3', 'catalog_pet_headline2_es', 'ctlg_pet_teaser1', '', 'Aquí tienes todo lo que necesitas para que tu mascota sea feliz, desde alimentos a juguetes y delicatessen... Es decir, todo para comer y hacer ejercicio ;)', '', '', ''),
(110, 488, 'Brinquedos para Mascotes', 199, '1', '1', 1, '0', 19, 'baby_pet_accessories', 'default_3x3', 'catalog_pet_headline2', 'catalog_teaser_babybear', '', '¡Han llegado los Bebés Mascotas! ¡Cuídalos bien y mantenlos felices con nuestra fascinante gama de comida y juguetes!', '', 'Consigue accesorios chulos para tu Mascota.', ''),
(111, 449, 'Plantas Monstruosas', 153, '0', '0', 1, '0', 20, 'monster_plants_info', 'pets3', 'catalog_header_mopla_01', 'ctlg_monster_note', '', 'Las Plantas Monstruosas pueden ser complicadas. Esta página te da algunos consejos más para criar y cuidar tu monstruosa prole.', '', 'Cuidar de tu Planta', 'Cuida tus plantas con frecuencia o morirán. Para asegurarte de que tu planta esté sana, cuídala cada 30 horas más o menos. Si muere, puedes usar la Poción resucitadora para devolverla a la vida.'),
(112, 111, 'Semillas', 156, '0', '0', 1, '0', 0, 'monster_plant_seeds', 'default_3x3', 'catalog_header_mopla_01', 'quest_teaser_monsterplants', '', 'Planta las semillas en tu Sala y cuídalas para que estén sanas y no se mueran. Cuando tus plantas hayan madurado, podrás cruzarlas para intentar conseguir descendencia mejorada. ¡Sólo una vez sin Poción de recultivo!', '', '', ''),
(113, 111, 'Poción para Plantas', 155, '0', '0', 1, '0', 0, 'monster_plant_potions', 'default_3x3', 'catalog_header_mopla_01', 'quest_teaser_monsterplants', '', 'En esta página encontrarás todo lo que necesitas para cuidar de tus plantas: Resucitadora de plantas para cuando tus plantas mueran.', '', '', ''),
(114, 111, 'Jardim', 157, '0', '1', 1, '0', 0, 'gardening_set', 'default_3x3', 'catalog_header_mopla_01', 'quest_teaser_monsterplants', '', '¡Ya es hora de que cuides de tus plantas!', '', '', ''),
(115, 449, 'Wired', 80, '1', '1', 1, '0', 15, 'category_wired', 'pets2', 'catalog_wired_header1', 'ctlg_pic_teaser_wired', '', 'Mobis Wired lhe dar quase infinitas possibilidades. Você pode fazer seu Mobis fazer quase qualquer coisa se você aprender como usar disparadores, Efeitos e Condições.', 'Cada um pode ser programado separadamente.  sendo eles seu Causador, Efeito e Condição uns sobre os outros e trabalhar juntos para transformar sua sala!', 'Como funciona?', 'Para obter um resultado precisa de três tipos de mobis wireds:[10][10]1. Ativadores: Coisas que você precisa para ter algum efeito.[10]2. Efeitos:Oque acontece depois de ativado um causante[10]3. Condição (opcional): Condições que devem ser cumpridas antes do Causador ser lançado. [10] [10] No entanto funciona, Ativador + Efeito + Condição = Resultado.'),
(116, 115, 'Series', 84, '1', '1', 1, '0', 0, 'wired_deals', 'default_3x3_extrainfo', 'catalog_wired_header6_es', 'ctlg_pic_wired_deals', '', '¡La forma más fácil de sacar partido a los Furni Wired es a través de las series! Cada una de ellas contiene todos los Furni necesarios para dar lugar a una acción específica, como ''Puertas con contraseña''.', '', '¡Haz clic en cada serie para ver qué contiene!', ''),
(117, 115, 'Wired: ¡nuevos!', 80, '0', '0', 1, '0', 0, 'wired', 'default_3x3_extrainfo', 'catalog_wired_header2_es', 'ctlg_pic_wired_triggers', '', 'Los Causantes permiten definir qué se necesita que pase para que tenga lugar un Efecto. Para programar un Causante, colócalo en una Sala, haz doble clic en él y ponlo en marcha. Necesitarás apilar un Efecto sobre un Causante.', '', '¡Haz clic en cada objeto para ver cómo funciona!', ''),
(118, 115, 'Ativador', 81, '1', '1', 1, '0', 0, 'wired_triggers', 'default_3x3_extrainfo', 'catalog_wired_header2_es', 'ctlg_pic_wired_triggers', '', 'Los Causantes permiten definir qué se necesita que pase para que tenga lugar un Efecto. Para programar un Causante, colócalo en una Sala, haz doble clic en él y ponlo en marcha. Necesitarás apilar un Efecto sobre un Causante.', '', '¡Haz clic en cada objeto para ver cómo funciona!', ''),
(119, 115, 'Efeito', 82, '1', '1', 1, '0', 0, 'wired_effects', 'default_3x3_extrainfo', 'catalog_wired_header3_es', 'ctlg_pic_wired_effects', '', 'Los Efectos son lo que sucede después de haber activado un Causante. Para programar un Efecto, colócalo en una Sala, haz doble clic en él y ponlo en marcha. Necesitarás siempre apilar un Causante sobre un Efecto.', '', '¡Haz clic en cada objeto para ver lo que hace cada Efecto!', ''),
(120, 115, 'Condições', 83, '1', '1', 1, '0', 0, 'wired_conditions', 'default_3x3_extrainfo', 'catalog_wired_header4_es', 'ctlg_pic_wired_conditions', '', 'Las Condiciones son determinados criterios que deben ser especificados antes de que el Causante se ponga en marcha. Si quieres usar una Condición, deberás apilarla sobre un Causante y un Efecto.', '', '¡Haz clic en cada objeto para ver cómo funcionan las Condiciones!', ''),
(121, 115, 'Extras', 85, '1', '1', 1, '0', 0, 'wired_addons', 'default_3x3_extrainfo', 'catalog_wired_header5_es', 'ctlg_pic_wired_support_furniture', '', 'Utiliza estos Furni simplemente para dar algo más de sabor a tu Sala Wired. Necesitarás apilar un Complemento sobre un Causante, un Efecto y una Condición para que funcione.', '', '¡Haz clic en cada objeto para ver de qué van los Complementos!', ''),
