(123, 115, 'Classificadores', 82, '1', '1', 1, '0', 0, 'wired_leaderboard', 'default_3x3', 'catalog_wired_header1', '', '', 'El Máximas Puntuaciones permite hacer un seguimiento de los puntos conseguidos en tus juegos y mostrarlos en tus Salas.', '', 'Haz clic en los objetos para obtener detalles', ''),
(124, 449, 'Música', 4, '1', '1', 1, '0', 14, 'shop_music', 'default_3x3', 'catalog_djshop_headline1', 'catalog_djshop_teaser1', '', '¡Es hora de divertirse! Coloca una Jukebox en una de tus Salas, añade varios discos de la sección ''Habbo Hotel Hits'' a la misma y ya lo tendrás todo listo para montar un gran fiestó', '', '', ''),
(126, 449, 'Jogos', 202, '1', '1', 1, '0', 13, 'category_games', 'pets3', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '', 'Los juegos te están esperando... ¡Preparado, listo, ya!', '', '¡Selecciona el juego y a jugar!', 'Echa un vistazo al menú "deportes" que hemos preparado y decide cuál quieres probar primero. ¿Estás preparado? '),
(127, 126, 'Regras Banzai', 42, '0', '0', 1, '0', 0, 'gameset_battle_banzai_info', 'pets2', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '', 'Lee las instrucciones y descubre cómo jugar al Battle Banzai. ¡No hay tiempo que perder!', '', '¿Cómo crear tu propia Sala de Battle Banzai?', '1. Ve a tu Sala[13][10]2. Coloca casillas Banzai en el suelo y vallas para limitar el campo de juego[13][10]3. Añade un Vestuario Banzaien cada lado para cada equipo. Hay cuatro opciones: azul, rojo, amarillo y verde[13][10]4. Coloca el Contador y los Marcadores en el terreno de juego[13][10]5. Una vez esté todo listo, di a tus amigos que se preparen[13][10]6. Haz clic en el Contador e inicia el juego'),
(128, 126, 'Battle Banzai', 78, '1', '1', 1, '0', 0, 'gameset_battle_banzai', 'default_3x3', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '', '¿Más grande? ¿Mejor? ¡Banzai! Ahora tú eres quien decide las reglas de tu propio juego de Bttle Banzai, el que montes en una de tus Salas Privadas. ¡Tú tienes el poder!', '', '', ''),
(129, 126, 'Regras Freeze', 42, '0', '0', 1, '0', 0, 'gameset_freeze_info', 'pets2', 'catalog_freeze_en', 'ctlg_teaser_es', '', 'Descubre aquí cómo crear un recinto donde poder jugar a ''Freeze'' y, además, cómo jugar exactamente.', 'Recuerda: ¡pon siempre los Bloques sobre una Casilla Freeze! Si no, no funcionarán.', '¡Así es como puedes crear tu propia partida!', '1. Ve a tu Sala.[10]2. Coloca Casillas y Bloques Freeze en el suelo y utiliza Paredes para delimitar el terreno de juego. ¡Pon siempre los Bloques sobre una Casilla![10]3. Añade un acceso para cada equipo en tu Sala. Puede haber un máximo de cuatro equipos: amarillo, azul, rojo y verde.[10]4. Coloca un Contador y un Marcador en el terreno de juego.[10]5. Finalmente, coloca una Casilla de Salida fuera del terreno de juego. Ahí serán enviados los jugadores cuando ya no les quede ninguna vida.[10]6. ¿Listo? Llama a tus amigos y deja que elijan equipo. Cada uno puede tener hasta un máximo de cinco jugadores.[10]7. Haz clic en el Contador y deja que empiece el juego.'),
(130, 126, 'Freeze', 87, '1', '1', 1, '0', 0, 'gameset_freeze', 'default_3x3', 'catalog_freeze_en', 'ctlg_teaser_es', '', 'Seguro que después de participar en este juego ya no te gusta tanto la nieve... Compite por equipos y consigue que impacten el mayor número de bolas de nieve posibles sobre tus contrincantes. ¡Son como auténticas bombas!', '', '', ''),
