(134, 126, 'Niko', 141, '0', '0', 1, '0', 0, 'gameset_niko', 'niko', 'catalog_header_niko_en', 'catalog_niko_en', 'catalog_speech_niko_en2', 'Niko ya está aquí. Es un juego de plataformas que desafía tu habilidad con los dedos y el cerebro. Niko tiene que correr de nivel en nivel escapando de las trampas, rescatando amigos y coleccionando recompensas y premios de Habbo. Pruébalo gratis.', '', '', ''),
(135, 126, 'Lost Monkey', 128, '0', '0', 1, '0', 0, 'gameset_lost_monkey', 'monkey', 'catalog_monkey_headline', 'catalog_monkey_teaser', 'catalog_monkey_store2_en', 'Lost Monkey está disponible GRATIS para iPhone, iPod Touch y Android. Juega a 3 minijuegos diferentes para hacerte con Furni Habbo exclusivo y una mascota Lost Monkey. ¡Ayuda a tu mono a escapar de la isla desierta y volver a Habbo!', '', '', ''),
(136, 449, 'Moedas', 6, '1', '1', 1, '0', 3, 'credit_exchange', 'default_3x3', 'catalog_bank_headline1_es', 'catalog_bank_teaser', '', 'Converte teus Créditos em uma moeda especial.', '', '', ''),
(137, 449, 'Mercado Livre', 69, '0', '0', 1, '0', 25, 'marketplace_info', 'pets2', 'catalog_marketplace_header_es', 'teaser_marketplace', '', 'El Habbo Mercadillo es una forma segura y conveniente de comprar y vender objetos en Habbo.', '', '¿Cómo funciona el Habbo Mercadillo?', 'Vender objetos: [10]Puedes vender cualquier item que sea tradeable seleccionándolo en tu Inventario y haciendo clic en ''Vender en Mercadillo'', incluidos los que en ese momento estén a la venta en la Tienda.[10][10]Comprar objetos:[10]Selecciona el objeto deseado entre las ''Ofertas'' del Mercadillo y haz clic en ''Comprar''. Te garantizamos que tendrás el objeto al precio más barato disponible en ese momento. [10][10]Requisitos de uso: [10]Para usar el Mercadillo deberás tener activado el  "Pase de Tradeo". Ã‰ste podrás conseguirlo completando el primer nivel del "Camino del ciudadano"'),
