(84, -1, 'Grupos', 203, '1', '1', 1, '0', 15, 'guild_frontpage', 'guild_frontpage', 'catalog_groups_es', 'catalog_groupsteaser_es', '', 'Los Habbo Grupos son una forma sencilla de ganar fama en Internet. Crea el tuyo aquí mismo.', '', '* Reúnete con gente con la que sueles estar en contacto[13][10]* Coopera en la decoración de las Salas de reunión[13][10]* Luce con orgullo tu Placa de Grupo[13][10]* Hazte con Furni sorprendente del color de tu Grupo', 'Aquí tienes algunos beneficios a considerar:'),
(85, 84, 'Furni de Grupo', 207, '1', '1', 1, '0', 1, 'guild_custom_furni', 'guild_custom_furni', 'catalog_groups_es', '', '', '¡Logra Furni customizados con los colores de tu Grupo!', '', 'Elige un Furni o Grupo', ''),
(86, 84, 'Foros de Grupo', 207, '1', '1', 1, '0', 0, 'guild_forum', 'guild_forum', '', '', '', '¡Los Foros de Grupo ya están aquí!', '', '<<i><b><font color="#0e3f52" size="16">¿Qué es un foro de grupo?</font></b></i>[10][10]Los Foros te permiten publicar, comentar y discutir temas libremente, ¡y sin tener que dejar el Hotel![10][10]<i><b><font color="#0e3f52" size="16">¿Quién puede activar un foro? </font></b></i>[10][10]Solo el dueño de un grupo puede activar un foro.[10][10]<i><b><font color="#0e3f52" size="16">¿Necesito un Panel de Foro?</font></b></i>[10][10]Sí. Para poder empezar un Foro de Grupo el dueño tiene que comprar el Panel de Foro.[10][10][10]Para más información sobre los Foros de Grupo pincha <a href="event:habbopages/forums">aquí</a>.[10][10][10]Próximamente iremos añadiendo nuevas funcionalidades a esta herramienta.', ''),
(87, -1, 'BOTs', 65, '1', '1', 1, '0', 16, 'bots', 'default_3x3', 'catalog_bots_headline1_en', 'catalog_bots_headline1_en', '', '¡Compra tu propio Bot. Pueden hablar, caminar y darle estilo a cualquier sala!', '', '', 'Nota: Los Bots se pueden personalizar una vez los tengas en tu Sala.'),
(88, 429, 'Avatar', 61, '1', '1', 1, '0', 17, 'perm_effects', 'default_3x3', 'avatar_fx_header', 'catalog_pxl_teaser1_en', '', '¿Quieres destacar entre la multitud? ¡Consigue estos Efectos Lacrimógenos y asegúrate de ser el centro de atención!', '', '', ''),
(89, 429, 'Disfraces', 205, '1', '1', 1, '0', 0, 'perm_costumes', 'default_3x3_extrainfo', 'avatar_fx_header', 'hween12_costumepromo', '', 'Con estos Disfraces tendrás el mejor aspecto para estar en el escenario o andar por la alfombra roja.', '', '', ''),
(90, -1, 'Caballo', 132, '1', '1', 1, '0', 18, 'pet_horse', 'pets', 'catalog_horse_header1_es', '', '', 'Cabalga por el Hotel a lomos de tu Caballo. Para poder subirte debes hacerte primero con una Montura. También podrás customizar el color de su piel y el de su melena. Ah, ¡y no te olvides de todos los accesorios! ', '', 'Dale un nombre:', ''),
(91, 90, 'Monturas', 135, '1', '1', 1, '0', 0, 'horse_saddle', 'petcustomization', 'catalog_saddles_header1_es', 'horse_teaser', '', 'Para usar una Montura, colócala primero en una Sala en donde haya al menos un Caballo. Luego clica en ella y selecciona a qué Caballo ponérsela. Finalmente, haz clic en el Caballo y selecciona ''Usar montura''. ¡Así de fáci', '', '', ''),
(92, 90, 'Tintes', 133, '1', '1', 1, '0', 0, 'horse_dyes', 'petcustomization', 'catalog_horsedyes_header1_es', 'horse_teaser', '', 'Customiza tu Caballo con diferentes colores para el pelo o tipos de cuerpo. Cada uno sólo se puede usar una vez, y para ello debes colocarlo en tu Sala, hacer doble clic y elegir qué Caballo quieres que cambie de apariencia.', '', '', ''),
(93, 90, 'Crines', 134, '1', '1', 1, '0', 0, 'horse_styles', 'default_3x3', 'catalog_horsehairstyles_header1_es', 'horse_teaser', '', 'Customiza a tu Caballo dándole la oportunidad de llevar un determinado estilo de peinado. Para usar cada uno, colócalo en tu Sala, haz doble clic y elige qué Caballo quieres customizar.', '', '', ''),
(94, 90, 'Accesorios', 216, '1', '1', 1, '0', 0, 'horse_furni', 'default_3x3', 'catalog_horseaccessories_header1_es', 'horse_teaser', '', 'Encuentra aquí todo lo necesario para el cuidado de tu Caballo y para crear tu propio Establo o Rancho.', '', '', ''),
(95, 90, 'Saltar a Caballo', 226, '1', '1', 1, '0', 0, 'horse_jump_pilot', 'default_3x3', 'catalog_header_jumping_en', 'horse_teaser', '', 'Estos Furni son para que tu Caballo salte. Construye una pista de carreras y obstáculos. Entrena hasta convertirte en el mejor jinete de tu hipódromo o el de tus amig@s.', '', '', ''),
(96, -1, 'Mascotas', 8, '1', '1', 1, '0', 19, 'pets_info', 'pets3', 'catalog_pet_headline1_es', 'ctlg_pet_note', '', 'Las Mascotas también son habitantes del Hotel, por lo que cada dueño necesita saber un poco de información sobre ellas. ¡Cuídalas como es debido![0]#Algunos consejos a tener en cuenta:', '- Ã“rdenes exclusivas del dueño: SIGUEME, VEN, PEDIR, VETE, MALA, DUERME, HAZ EL MUERTO.[10][10]- Más: SIENTATE, TUMBATE, SALTA, VOZ, BUENA', 'Algunos consejos a tener en cuenta:', '- Puedes colocar Mascotas en tu Sala o llevarte una de ellas a la Sala de otro usuario que las admita.[10]- No puedes tradear tus Mascotas, pero ellas pueden ir a las Salas de tus amigos para recibir caricias.[10]- Puedes tener hasta 50 Mascotas en tu Sala, ¡pero deberás cuidarlas a todas![10]- Cuida a tu Mascota alimentándola y tratándola bien. Echa un vistazo a la sección ''Accesorios''.[10]- Consigue Placas y Recompensas entrenando a tus Mascotas.'),
(97, 96, 'Dragones', 109, '1', '1', 1, '0', 13, 'pet_dragon', 'pets', 'catalog_pet_headline1_es', '', '', '¿List@ para permitir unas cuantas llamaradas en tu Sala? Hazte con cualquiera de las razas de Dragones que puedes ver aquí a golpe de clic. ', '', '', ''),
(98, 96, 'Osos', 68, '1', '1', 1, '0', 23, 'pet_polar_bear', 'pets', 'catalog_pet_headline1_es', '', '', 'Cuenta con una gruesa piel y es omnívoro. ', '', '', ''),
(99, 96, 'Terrier', 24, '1', '1', 1, '0', 32, 'pet_terrier', 'pets', 'catalog_pet_headline1_es', '', '', 'Originario de las altas montañas de Escocia. ', '', '', ''),
(100, 96, 'Leones', 76, '1', '1', 1, '0', 20, 'pet_lion', 'pets', 'catalog_pet_headline1_es', '', '', 'Fiero depredador de la naturaleza, el León se ha vuelto algo manso en Habbo Hotel. ', '', '', ''),
(101, 96, 'Tortugas', 126, '1', '1', 1, '0', 33, 'pet_turtle', 'pets', 'catalog_pet_headline1_es', '', '', 'Ha sido suficiente con oír que en Habbo tenemos unas olas fabulosas y un mar transparente para que una nueva Mascota haya asomado su cabeza en el Hotel: ¡la Tortuga! ', '', '', ''),
(102, 96, 'Cocodrilos', 22, '1', '1', 1, '0', 7, 'pet_crocodile', 'pets', 'catalog_pet_headline1_es', '', '', 'Piel áspera, gruñidos y una dentadura de acero... ', '', '', ''),
