(108, 96, 'Bebés Mascota', 228, '1', '1', 1, '0', 5, 'babypets', 'default_3x3', 'catalog_header_babybear', 'catalog_teaser_babybear', '', 'Necesitas un Nido de Cruce y dos Mascotas Adultas del mismo tipo para cruzarlas y conseguir Bebés Mascotas. Al menos una de las Mascotas Adultas debe ser tuya. El Nido de Cruce desaparece cuando se produce el cruce.', '', '', ''),
(109, 96, 'Comida para Mascotas', 201, '1', '1', 1, '0', 8, 'pet_accessories', 'default_3x3', 'catalog_pet_headline2_es', 'ctlg_pet_teaser1', '', 'Aquí tienes todo lo que necesitas para que tu mascota sea feliz, desde alimentos a juguetes y delicatessen... Es decir, todo para comer y hacer ejercicio ;)', '', '', ''),
(110, 96, 'Juguetes y Accesorios', 199, '1', '1', 1, '0', 19, 'baby_pet_accessories', 'default_3x3', 'catalog_pet_headline2', 'catalog_teaser_babybear', '', '¡Han llegado los Bebés Mascotas! ¡Cuídalos bien y mantenlos felices con nuestra fascinante gama de comida y juguetes!', '', 'Consigue accesorios chulos para tu Mascota.', ''),
(111, -1, 'Plantas Monstruosas', 153, '0', '1', 1, '0', 20, 'monster_plants_info', 'pets3', 'catalog_header_mopla_01', 'ctlg_monster_note', '', 'Las Plantas Monstruosas pueden ser complicadas. Esta página te da algunos consejos más para criar y cuidar tu monstruosa prole.', '', 'Cuidar de tu Planta', 'Cuida tus plantas con frecuencia o morirán. Para asegurarte de que tu planta esté sana, cuídala cada 30 horas más o menos. Si muere, puedes usar la Poción resucitadora para devolverla a la vida.'),
(112, 111, 'Semillas', 156, '0', '0', 1, '0', 0, 'monster_plant_seeds', 'default_3x3', 'catalog_header_mopla_01', 'quest_teaser_monsterplants', '', 'Planta las semillas en tu Sala y cuídalas para que estén sanas y no se mueran. Cuando tus plantas hayan madurado, podrás cruzarlas para intentar conseguir descendencia mejorada. ¡Sólo una vez sin Poción de recultivo!', '', '', ''),
(113, 111, 'Poción para Plantas', 155, '0', '0', 1, '0', 0, 'monster_plant_potions', 'default_3x3', 'catalog_header_mopla_01', 'quest_teaser_monsterplants', '', 'En esta página encontrarás todo lo que necesitas para cuidar de tus plantas: Resucitadora de plantas para cuando tus plantas mueran.', '', '', ''),
(114, 111, 'Jardinería', 157, '0', '1', 1, '0', 0, 'gardening_set', 'default_3x3', 'catalog_header_mopla_01', 'quest_teaser_monsterplants', '', '¡Ya es hora de que cuides de tus plantas!', '', '', ''),
(115, -1, 'Wired', 80, '1', '1', 1, '0', 21, 'category_wired', 'pets2', 'catalog_wired_header1', 'ctlg_pic_teaser_wired', '', 'Los Furni Wired te dan posibilidades casi infinitas. Podrás hacer que tus Furni hagan prácticamente de todo si aprendes cómo utilizar los Causantes, Efectos y Condiciones.', 'Cada uno de ellos puede ser programado por separado. Apila tu Causante, Efecto y Condición uno encima de otro, ¡y trabajarán en conjunto para transformar tu Sala!', '¿Cómo funcionan?', 'Para conseguir un resultado Wired completo necesitas tres tipos de Furni:[10][10]1. Causantes: Cosas que necesitas hacer para que tenga lugar un Efecto.[10]2. Efectos: Lo que sucede una vez has activado un Causante.[10]3. Condiciones (opcional): Condiciones que deben darse antes de que el Causante se ponga en marcha.[10][10]Con todo, Causante+Efecto+Condición=Wired'),
(116, 115, 'Series', 84, '1', '1', 1, '0', 0, 'wired_deals', 'default_3x3_extrainfo', 'catalog_wired_header6_es', 'ctlg_pic_wired_deals', '', '¡La forma más fácil de sacar partido a los Furni Wired es a través de las series! Cada una de ellas contiene todos los Furni necesarios para dar lugar a una acción específica, como ''Puertas con contraseña''.', '', '¡Haz clic en cada serie para ver qué contiene!', ''),
(117, 115, 'Wired: ¡nuevos!', 80, '0', '0', 1, '0', 0, 'wired', 'default_3x3_extrainfo', 'catalog_wired_header2_es', 'ctlg_pic_wired_triggers', '', 'Los Causantes permiten definir qué se necesita que pase para que tenga lugar un Efecto. Para programar un Causante, colócalo en una Sala, haz doble clic en él y ponlo en marcha. Necesitarás apilar un Efecto sobre un Causante.', '', '¡Haz clic en cada objeto para ver cómo funciona!', ''),
(118, 115, 'Causantes', 81, '1', '1', 1, '0', 0, 'wired_triggers', 'default_3x3_extrainfo', 'catalog_wired_header2_es', 'ctlg_pic_wired_triggers', '', 'Los Causantes permiten definir qué se necesita que pase para que tenga lugar un Efecto. Para programar un Causante, colócalo en una Sala, haz doble clic en él y ponlo en marcha. Necesitarás apilar un Efecto sobre un Causante.', '', '¡Haz clic en cada objeto para ver cómo funciona!', ''),
(119, 115, 'Efectos', 82, '1', '1', 1, '0', 0, 'wired_effects', 'default_3x3_extrainfo', 'catalog_wired_header3_es', 'ctlg_pic_wired_effects', '', 'Los Efectos son lo que sucede después de haber activado un Causante. Para programar un Efecto, colócalo en una Sala, haz doble clic en él y ponlo en marcha. Necesitarás siempre apilar un Causante sobre un Efecto.', '', '¡Haz clic en cada objeto para ver lo que hace cada Efecto!', ''),
(120, 115, 'Condiciones', 83, '1', '1', 1, '0', 0, 'wired_conditions', 'default_3x3_extrainfo', 'catalog_wired_header4_es', 'ctlg_pic_wired_conditions', '', 'Las Condiciones son determinados criterios que deben ser especificados antes de que el Causante se ponga en marcha. Si quieres usar una Condición, deberás apilarla sobre un Causante y un Efecto.', '', '¡Haz clic en cada objeto para ver cómo funcionan las Condiciones!', ''),
(121, 115, 'Complementos', 85, '1', '1', 1, '0', 0, 'wired_addons', 'default_3x3_extrainfo', 'catalog_wired_header5_es', 'ctlg_pic_wired_support_furniture', '', 'Utiliza estos Furni simplemente para dar algo más de sabor a tu Sala Wired. Necesitarás apilar un Complemento sobre un Causante, un Efecto y una Condición para que funcione.', '', '¡Haz clic en cada objeto para ver de qué van los Complementos!', ''),
(122, 115, 'Efecto de Sonido', 4, '1', '1', 1, '0', 0, 'sound_fx', 'default_3x3', 'catalog_wired_header1', 'teaser_sfx_2', '', '', '', '', ''),
(123, 115, 'Clasificaciones', 80, '1', '1', 1, '0', 0, 'wired_leaderboard', 'default_3x3', 'catalog_wired_header1', '', '', 'El Máximas Puntuaciones permite hacer un seguimiento de los puntos conseguidos en tus juegos y mostrarlos en tus Salas.', '', 'Haz clic en los objetos para obtener detalles', ''),
(124, -1, 'Tienda de Música', 257, '1', '1', 1, '0', 11, 'trax_jukebox', 'default_3x3', 'catalog_djshop_headline1', 'catalog_djshop_teaser1', '', '¡Es hora de divertirse! Coloca una Jukebox en una de tus Salas, añade varios discos de la sección ''Habbo Hotel Hits'' a la misma y ya lo tendrás todo listo para montar un gran fiestó', '', '', '¡Combina perfectamente con Furni Neón!'),
(126, -1, 'Juegos', 202, '1', '1', 1, '0', 23, 'category_games', 'pets3', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '', 'Los juegos te están esperando... ¡Preparado, listo, ya!', '', '¡Selecciona el juego y a jugar!', 'Echa un vistazo al menú "deportes" que hemos preparado y decide cuál quieres probar primero. ¿Estás preparado? '),
(127, 126, 'Reglas Banzai', 42, '1', '1', 1, '0', 0, 'gameset_battle_banzai_info', 'pets2', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '', 'Lee las instrucciones y descubre cómo jugar al Battle Banzai. ¡No hay tiempo que perder!', '', '¿Cómo crear tu propia Sala de Battle Banzai?', '1. Ve a tu Sala[13][10]2. Coloca casillas Banzai en el suelo y vallas para limitar el campo de juego[13][10]3. Añade un Vestuario Banzaien cada lado para cada equipo. Hay cuatro opciones: azul, rojo, amarillo y verde[13][10]4. Coloca el Contador y los Marcadores en el terreno de juego[13][10]5. Una vez esté todo listo, di a tus amigos que se preparen[13][10]6. Haz clic en el Contador e inicia el juego'),
(128, 126, 'Battle Banzai', 78, '1', '1', 1, '0', 0, 'gameset_battle_banzai', 'default_3x3', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '', '¿Más grande? ¿Mejor? ¡Banzai! Ahora tú eres quien decide las reglas de tu propio juego de Bttle Banzai, el que montes en una de tus Salas Privadas. ¡Tú tienes el poder!', '', '', ''),
(129, 126, 'Reglas Freeze', 42, '1', '1', 1, '0', 0, 'gameset_freeze_info', 'pets2', 'catalog_freeze_en', 'ctlg_teaser_es', '', 'Descubre aquí cómo crear un recinto donde poder jugar a ''Freeze'' y, además, cómo jugar exactamente.', 'Recuerda: ¡pon siempre los Bloques sobre una Casilla Freeze! Si no, no funcionarán.', '¡Así es como puedes crear tu propia partida!', '1. Ve a tu Sala.[10]2. Coloca Casillas y Bloques Freeze en el suelo y utiliza Paredes para delimitar el terreno de juego. ¡Pon siempre los Bloques sobre una Casilla![10]3. Añade un acceso para cada equipo en tu Sala. Puede haber un máximo de cuatro equipos: amarillo, azul, rojo y verde.[10]4. Coloca un Contador y un Marcador en el terreno de juego.[10]5. Finalmente, coloca una Casilla de Salida fuera del terreno de juego. Ahí serán enviados los jugadores cuando ya no les quede ninguna vida.[10]6. ¿Listo? Llama a tus amigos y deja que elijan equipo. Cada uno puede tener hasta un máximo de cinco jugadores.[10]7. Haz clic en el Contador y deja que empiece el juego.'),
(130, 126, 'Freeze', 87, '1', '1', 1, '0', 0, 'gameset_freeze', 'default_3x3', 'catalog_freeze_en', 'ctlg_teaser_es', '', 'Seguro que después de participar en este juego ya no te gusta tanto la nieve... Compite por equipos y consigue que impacten el mayor número de bolas de nieve posibles sobre tus contrincantes. ¡Son como auténticas bombas!', '', '', ''),
