(140, -1, 'Furni-Matic', 163, '1', '1', 1, '0', 26, 'ecotron_transform', 'recycler', 'catalog_header_furnimatic', 'ctlg_furnimatic_image', '', '¡Mete tus Furnis antiguos en la Furni-Matic y obtén Furnis nuevos! Echa un vistazo a los premios que recibirás por reciclar y a las instrucciones sobre cómo hacerlo.  ¡Arrastra un Furni hasta cada una de las cajas que aparecen más abajo y haz clic en Empezar!', '', '', ''),
(141, 140, 'Instrucciones', 42, '0', '0', 1, '0', 0, 'ecotron_info', 'recycler_info', 'catalog_header_furnimatic', 'ctlg_ecotron_box', '', '¡La Furni-Matic es una máquina de creación de Furnis! ¡Mete tus Furnis antiguos en la máquina y obtén algo nuevo a cambio! ¡No se admiten devoluciones!', '', 'Uso de la Furni-Matic', '1. Mantén abierta la ventana Furni-Matic principal y haz clic en el botón "Mis cosas". Verás que la mayoría de los objetos tienen símbolos de reciclado: puedes hacer clic en ellos y arrastrarlos a la Furni-Matic. [13][10][13][10]2. Cuando tengas los suficientes objetos, haz clic en "Empezar" y busca la caja Furni-Matic en tu inventario.[13][10][13][10]3. Haz clic en la caja para ver su etiqueta. Abre la caja o tradéala sin abrirla. El contador muestra el tiempo que debes esperar antes de meter más objetos en la Furni-Matic.[13][10][13][10]PD: Echa un ojo a las Recompensas antes de reciclar: ¡que no te sorprenda la sorpresa!'),
