(315, 144, 'Velho Oeste', 229, '1', '1', 1, '0', 63, '', 'default_3x3', 'catalog_header_wwest', 'catalog_teaser_wildwest', '', 'Desde el Saloon hasta la Oficina del Sheriff, y todas las baldosas del suelo, los cactus y las plantas rodadoras entre medias... Los furnis del Salvaje Oeste han llegado a la ciudad.', '', 'Haz clic en un ítem para más detalles.', ''),
(314, 313, 'Lote de Sala Palooza Hoopla', 206, '0', '0', 1, '0', 0, '', 'single_bundle', 'catalog_header_roombuilder', 'jul14_palooza_internal', '', 'Más grande, más brillante, mejor. Este año Palooza viene repleto de cosas. Este lote contiene fantásticos furnis, además de una placa y un furni exclusivo. Disponible por tiempo limitado, hazte con uno antes de que el festival termine...', 'Compra aquí y ahórrate 50%. <a href="event:habblet/open/credits">Learn More</a>', 'También disponible en la Página de Créditos', '<i><b><font color="#ba3733" size="16">Qué incluye:</b></i>'),
(316, 385, 'Bugados', 51, '1', '1', 1, '0', 106, '', 'default_3x3', 'palooza_2014_catalog_header', 'catalog_teaser_palooza', '', '¡Saca del armario tus lentejuelas y purpurina porque los Furnis Habbo Palooza han vuelto! ¡Hay cientos de cosas entre las que elegir!', '', '', ''),
(317, 84, 'Mobis de Grupo Pirata', 207, '1', '1', 1, '0', 2, 'guild_custom_furni', 'guild_custom_furni', 'catalogue_pirate_header', 'pirate_teaser', '', '¡Qué miedo de los Piratas y sus Grupos! Con los nuevos Furnis "customizables". Selecciona tu Grupo y haz que tus furnis tengan el color de tu Grupo. ', '', 'Selecciona un Furni o un Grupo', ''),
(318, 144, 'Universidade', 230, '1', '1', 1, '0', 66, '', 'default_3x3', 'university_new_furni_catalog_header', 'sep14_professor_internal', '', 'Hipster, empollón, cachitas, gamer ¡Todo Habbo tiene su propio estilo!', '', '', ''),
(319, 144, 'FurniMatic 2014', 163, '1', '1', 1, '0', 55, '', 'default_3x3', '', 'university_catalog_teaser', '', 'Desde que llegaron los FurniMatic... nada volvió a ser igual... Las máquinas comenzaron su revelión ¡Cuidado!', '', 'Haz clic en un ítem para más detalles.', ''),
(320, 144, 'Habboween 2014', 231, '1', '1', 1, '0', 70, '', 'default_3x3', 'hween14_catalog_header', 'hween14_catalog_teaser', '', 'Los Furnis más terroríficos de este año, ya están empezando a aterrizar en Lavvos... ¿Qué será lo próximo que nos deparan? ¿Vendrán más?... Quizás en la noche de los ¡MUERTOS!', '', '', ''),
