(392, 488, 'Pterodáctilo', 173, '1', '1', 1, '0', 29, '', 'pets', 'catalog_pet_headline1_es', '', '', 'Puede que estas mascotas tengan un aspecto feroz, con sus dientes afilados y sus largas garras... ¡pero no tienes nada que temer! A estas criaturas voladoras lo que más les gusta hacer es pasar el rato con sus dueños y surcar los cielos del Hotel. Ah, y no te olvides de darlas de comer su plato favorito... ¡hoja de col!', '', '', ''),
(393, 488, 'Velociraptor', 262, '1', '1', 1, '0', 34, '', 'pets', 'catalog_pet_headline1_es', '', '', 'Veloces y astutos, estos reptiles tienen fama de ser difíciles de mantener, increíblemente listos e infinitamente problemáticos. A menudo les encontrarás meditando sobre asuntos filosóficos o disfrutando de los pequeños placeres de la vida', '', '', ''),
