(395, 144, 'Natal 2015', 86, '1', '1', 1, '0', 100, '', 'default_3x3', 'catalog_header_xmas15', 'catalogue_teaser_newfurnixmas15', '', 'Monta tu sala con estos Furnis y inunda a todo el mundo con tú espíritu navideño, ¿¡Te has portado bien este año?! Si es así, seguro que Papa Noel, de la mano de los Reyes Magos te traerán multitud de regalos, aunque si has sido malo... ¿Quién sabe qué pasará? ¿Te secuestrará Papa Noel con su ejercito de duendes? ¿O simplemente te traerán carbón? Sea lo que sea ya es tarde... ¿O aún puedes salvarte montando una gran sala con estos magníficos Furnis?', '', '', ''),
(396, 488, 'Gnomo', 200, '1', '1', 1, '0', 17, '', 'pets', 'catalog_header_gnomes', 'catalog_teaser_gnome', '', 'El Polo Norte puede ser un lugar muy duro para un pequeño Gnomo, así que este año han decidido visitar tierras más cálidas. Dales de comer, entrénales y trátales con cariño... ¡Este travieso hombrecillo no andará por aquí mucho tiempo!', '', '', ''),
