(481, 372, 'São Valentim 2017', 144, '1', '1', 1, '0', 5, 'sanvalentin17', 'default_3x3', '', '', '', '¿Qué le vas a regalar a tu pareja el día de los enamorados? ¿No lo has pensado aún? Te traemos unos furnis que quizás te pueden ayudar a adornar su sala y quien sabe... Quizás oficies la ceremonia de tus amigos porque con estos furnis podrás hacer de todo en el tema del amor :)', '', '', ''),
