(1, -1, 'Inicio', 213, '1', '1', 1, '0', 1, 'front_page', 'frontpage4', 'catalog_frontpage_headline_shop_ES', 'frontpage_teaser', '', '<i><b><font color="#034782" size="16">¡Bienvenido al catálogo de iBoom!</font></b></i><br><br>Aquí podrás intercambiar tus monedas por objetos e incluso poner a vender tus pertenencias en el Mercadillo, ¡Explora nuestra tienda y te divertirás aun más!.<br><br><li>Unirme a <a href="event:catalog/open/habbo_club">iBoom Club</a></li><li><a href="event:catalog/open/set_pixelnew">Decorar </a> tu habitación </li><li>Adoptar una <a href="event:catalog/open/pet_horse">Mascota</a> o <a href="event:catalog/open/bots">Bot</a>.</li><li>Haz tu propios <a href="event:catalog/open/category_wired">juegos automáticos</a>.</li><li>Crea desde ya tu <a href="event:catalog/open/guild_frontpage">Grupo</a>.</li><br><i><b><font color="#7900d4" size="16">¿Cómo puedo conseguir diamantes?</font></b></i><br><br>En iBoom se reparten 4 diamantes por cada hora conectado y aparte de esa opción, tienes los eventos, las rifas, concursos e incluso oleadas de publicidad.<br><br><i>Última actualización:</i> 18 de Julio de 2016\r\n', '', 'Canjea tu código aquí:', ''),
