(13, 144, 'Stories', 210, '1', '1', 1, '0', 140, 'stories_es', 'default_3x3', 'catalog_header_stories', 'catalog_teaser_stories2', '', 'Con Habbo Stories tienes la oportunidad de llegar a ser un verdadero creador de historias y con estos furnis podrás crear las salas en las que inspirar al genio que llevas dentro.', '', '', ''),
