(322, 144, 'Navidad 2014', 232, '1', '1', 1, '0', 99, '', 'default_3x3', 'xmas14_catalog_header', 'xmas14_newfurni_spromo_teaser', '', '¡Navidad, navidad, dulce navidad! Por fin, llegaron los Furnis para ponerte a tono con el turrón, las castañas asadas y el carbón. ¿¡Quién sabe como se portaran los reyes este año?!', '', '', ''),
(324, 144, 'HabboWood 2014', 33, '1', '1', 1, '0', 72, '', 'default_3x3', 'ctlg_habbowood_headline1_sv', '', '', '¡Llegán los Oscars de este año, y con ellos los Habbowood renovados para montar tu propio Festival!', '', '', ''),
(325, 144, 'Baldosas de Colores', 179, '1', '1', 1, '0', 17, '', 'default_3x3', '', '', '', 'Aquí las teneis las baldosas de colores que tanto pediais, pronto más customs que nos pidais ;)', '', '', ''),
(326, 144, 'Alhambra 2014', 12, '1', '1', 1, '0', 3, '', 'default_3x3', 'alhambra_header', 'alhambra_teaser', '', '¡Llegan los Furnis más especiales para regalar en fiestas! ¿No sabes de cuáles te hablamos? Echales un ojo tu mismo son los Alhambra de este año :)', '', '', ''),
(327, 144, 'San Valentín 2015', 243, '1', '1', 1, '0', 131, '', 'default_3x3', 'val15_cata_header', 'val15_teaser', '', 'Se han anticipado, muchos llegan antes de tiempo, pero aún falta un buen puñado de Furnis ¿Qué más da? Ve decorando tu Sala y vistiendote para el día de los enamorados ¿Por qué ha de ser solo un día y no todo el año?', '', '', ''),
(328, 144, 'Tétrico', 242, '1', '1', 1, '0', 143, '', 'default_3x3', '', '', '', '¿Y estos Furnis? ¿¡De dónde han aparecido?! Que yuyu... Esta historia no pinta nada bien para los que usen estos Furnis he oído algo de una maldición', '', '', ''),
(329, 144, 'CyberPunk', 254, '1', '1', 1, '0', 39, '', 'default_3x3', 'catalog_header_cpunk15', 'catalog_teaser_cyberpunk', '', '¡Furnis Futuristas! Aquí mismo los tienes salen de la mismísima película "Yo Robot" dicen que vienen para ayudar a la humanidad... O al menos eso dicen ellos en principio ¿Y tú que crees?', '', '', ''),
(330, -1, 'Mobiliario Público', 264, '1', '0', 1, '0', 8, '', 'default_3x3', '', '', '', '¡Monta tus Propias Salas Públicas, o haz algún ROL! Saca a volar tu imaginación y no lo dudes más quizás seas premiado usandolos o quizás incluso alguna de tus Salas aparezca como Pública :)', '', '', ''),
(331, 144, 'Pascuas 2015', 255, '1', '1', 1, '0', 110, '', 'default_3x3', 'catalog_header_cland15', '', '', 'Come piruletas, montado a lomos del caballo arcoiris, ¡El mundo de las chucherias y del Conejo de Pascuas te eperán este año, con más Furnis que nunca! Disfruta desde ya de ellos y empieza a decorar tus Salas para los Concursos que se avecinan :) ¡Mucha Suerte y disfruta de la Semana Santa!', '', '', ''),
