(366, 144, 'Militar', 259, '1', '1', 1, '0', 89, '', 'default_3x3', 'catalog_header_army15', 'may15_army2_internal', '', '¡Organiza tu propio ejercito y conquista a golpe de pistola iBoom! ¿Serás capaz de organizar tu tropa correctamente?', '', '', ''),
(367, 144, 'Jurásico', 260, '1', '1', 1, '0', 80, '', 'default_3x3', 'jurassic15_catalog_header', 'dino_nf', '', '¡Descrube nuevos restos de dinosaurios! Adentrate en los más profundo de tu propio Jurassic Park, investiga con tus amigos y haya nuevos premios que vienen con ellos ;)', '', '', ''),
(370, 144, 'Paseo por París', 261, '1', '1', 1, '0', 112, '', 'default_3x3', 'catalog_header_paris', 'catalog_teaser_paris', '', '¡De las mejores Boutiques de París, llegan estos Furnis, que si Coco Channel, etc... Inundate del espíritu parisino, sumergete en sus calles, y vive como sus habitantes! ¿A qué esperas para empezar a decorar ya y hacer tus nuevas salas? :)', '', '', ''),
(371, 144, '15 Aniversario', 184, '1', '1', 1, '0', 1, '', 'default_3x3', '', '', '', 'Disfruta del 15 aniversario de Habbo con una saga exclusiva de furnis que te permitirán decorar tus salas de forma espléndida.', '', '', ''),
