(386, 144, 'iBoomWeen 2015', 262, '1', '1', 1, '0', 75, '', 'default_3x3', 'ctlg_hween15_header', 'ctlg_hween15_teaser', '', '¡Llegan los Furnis más terroríficos de todo el Hotel! Este año te traemos unos furnis que bien puestos en tu sala serán capaces de asustar al mismisimo Freddy Krueger, veamos... ¿Quién asustará a quién? ¡Wuajajajaja!', '', '', ''),
(387, 144, 'Cocina 2015', 1, '1', '1', 1, '0', 35, '', 'default_3x3', 'catalog_header_kitchen2015', 'teaser_kitchen2015', '', '¡A cocinar se ha dicho! ¿No sabes cocinar? Llama a tu madre, a una amiga o algún colega pero no te quedes sin comer tu comida favorita, conviertate en el próximo ganador de Top Chef gracias a estos furnis, añadelos a tu sala y... ¡A trabajar!', '', '', ''),
(388, 96, 'Gatitos', 20, '1', '1', 1, '0', 14, '', 'pets', 'catalog_pet_headline1_es', '', '', '', '', '', ''),
(389, 96, 'Perritos', 8, '1', '1', 1, '0', 26, '', 'pets', 'catalog_pet_headline1_es', '', '', '', '', '', ''),
