(391, 96, 'Obbahs', 212, '1', '1', 1, '0', 22, '', 'pets', 'catalog_pet_headline1_es', '', '', '', '', '', ''),
(392, 96, 'Pterodáctilos', 173, '1', '1', 1, '0', 29, '', 'pets', 'catalog_pet_headline1_es', '', '', 'Puede que estas mascotas tengan un aspecto feroz, con sus dientes afilados y sus largas garras... ¡pero no tienes nada que temer! A estas criaturas voladoras lo que más les gusta hacer es pasar el rato con sus dueños y surcar los cielos del Hotel. Ah, y no te olvides de darlas de comer su plato favorito... ¡hoja de col!', '', '', ''),
(393, 96, 'Velociraptors', 262, '1', '1', 1, '0', 34, '', 'pets', 'catalog_pet_headline1_es', '', '', 'Veloces y astutos, estos reptiles tienen fama de ser difíciles de mantener, increíblemente listos e infinitamente problemáticos. A menudo les encontrarás meditando sobre asuntos filosóficos o disfrutando de los pequeños placeres de la vida', '', '', ''),
(394, 96, 'Monos', 128, '1', '1', 1, '0', 21, '', 'pets', 'catalog_pet_headline1_es', '', '', 'Este travieso Monkey ha llegado al Hotel y ha conquistado nuestros corazones. ¡Mira como le queda esa boina último modelo, está de lo más adorable! ¡Y no te olvides de darle muchas bananas! ¡Le encantan! ¡Este Monkey marcará tu Habbo vida!', '', '', ''),
(395, 144, 'Navidad 2015', 86, '1', '1', 1, '0', 100, '', 'default_3x3', 'catalog_header_xmas15', 'catalogue_teaser_newfurnixmas15', '', 'Monta tu sala con estos Furnis y inunda a todo el mundo con tú espíritu navideño, ¿¡Te has portado bien este año?! Si es así, seguro que Papa Noel, de la mano de los Reyes Magos te traerán multitud de regalos, aunque si has sido malo... ¿Quién sabe qué pasará? ¿Te secuestrará Papa Noel con su ejercito de duendes? ¿O simplemente te traerán carbón? Sea lo que sea ya es tarde... ¿O aún puedes salvarte montando una gran sala con estos magníficos Furnis?', '', '', ''),
(396, 96, 'Gnomos', 200, '1', '1', 1, '0', 17, '', 'pets', 'catalog_header_gnomes', 'catalog_teaser_gnome', '', 'El Polo Norte puede ser un lugar muy duro para un pequeño Gnomo, así que este año han decidido visitar tierras más cálidas. Dales de comer, entrénales y trátales con cariño... ¡Este travieso hombrecillo no andará por aquí mucho tiempo!', '', '', ''),
(397, 96, 'Bebé Cerdo', 228, '1', '1', 1, '0', 2, 'babypets', 'pets', 'catalog_header_babybear', 'catalog_teaser_babybear', '', 'Dulces y amorosos, estos juguetones bebés mascotas te derritirán el corazón. ¡Elige la raza que más vaya contigo, educalos y haz de ellos tu fiel amig@ y mascota ideal!', '', '', ''),
(398, 96, 'Bebé Gato', 228, '1', '1', 1, '0', 3, 'babypets', 'pets', 'catalog_header_babybear', 'catalog_teaser_babybear', '', 'Dulces y amorosos, estos juguetones bebés mascotas te derritirán el corazón. ¡Elige la raza que más vaya contigo, educalos y haz de ellos tu fiel amig@ y mascota ideal!', '', '', ''),
