(400, -1, 'Tienda de Placas', 184, '1', '1', 1, '0', 10, 'ler', 'default_3x3', 'limited_header', '', '', 'La Tienda de Placa siempre estará disponible para que cualquier usuari@ pueda adquirir ciertas placas exclusivas, ¡Mira siempre de manera regultar la tienda y estate atent@! Ya que son cambiadas con frecuencia y también dependiendo de los eventos y campañas que se hacen con regularidad.', '', '', ''),
(401, 4, 'Nuevos HC', 172, '1', '1', 1, '0', 5, '', 'default_3x3', 'catalog_header_hc', 'hc_catalog_teaser', '', '¡¿Pensabas que ser miembro de Habbo Club no incluiría más Furnis nuevos?! Pues estabas equivocado querid@ amig@... Aquí están la nueva gama de Furnis HC para este año 2016 ¿A qué esperas para montar tú sala? ¿Será la tuya la próxima futura sala de reuniones para los HC''s más distinguidos?', '', '', ''),
(402, 144, 'Año Nuevo 2016', 168, '1', '1', 1, '0', 10, '', 'default_3x3', 'catalog_header_xmas15', 'spromo_ny2016crackable', '', 'Celebra el año nuevo con alegría, empieza a decorar tu Sala ¡DESDE YA! Este año tiene que ser muy especial, mejor que el anterior siempre :) ¡Felices fiestas y feliz año 2016 de parte de todo el Equipo de iBoom!', '', '', ''),
