(425, 144, 'Iced y Pura 2016', 72, '1', '1', 1, '0', 76, 'set_iced', 'default_3x3', 'catalog_iced_headline1_nl', 'catalog_iced_teaser1', '', 'Ya están aquí los nuevos furnis Pura y Iced recoloridos para el 2016, disfruta de ellos contarás con más de 250 furnis para adornar tus salas y hacerla la más chula de todo el Hotel ¿¡A qué esperas!?', '', '', ''),
(426, 144, 'Pascuas y Piratas 2016', 190, '1', '1', 1, '0', 111, '', 'default_3x3', 'catalogue_pirate_header', 'pirate_teaser', '', 'Cuenta una leyenda que el Pirata Barba Negra también le gustaba la Pascua... Tanto que se entero que había un tesoro oculto perdido entre unas islas, aquí te traemos su botín, aunque eso si... Lo que él no sabía que tenían una maldición, y tú... ¿Te atreverás a adornar tus salas con ellos? ', '', '', ''),
(427, 372, 'Superheroes y Variados', 263, '1', '1', 1, '0', 0, '', 'default_3x3', 'catalog_heroesch_smash', '', '', 'Este año es el año de los superheroes: Batman y Superman, Ironman vs Capitán América y X-Men Apocalipsis... ¿Y tú de que bando eres? ¿Cuál es tu superheroe favorito? Haz frente al mal con estos furnis', '', '', ''),
(428, 372, 'Jungla', 286, '1', '1', 1, '0', 0, '', 'default_3x3', 'african_header', 'african_catateaser', '', '¿Vivir en la jungla es imposible? ¡Pues con estos nuevos furnis podrás hacerlo! Sobrevive y haz tu propio ecosistema, obten recompensas a tavés de las semillas, riegalas y da de comer a tu compañero el chimpancé :)', '', '', ''),
