(1, -1, 'Inicio', 1871, '1', '1', 1, 'index', 'frontpage4', 'catalog_frontpage_headline_shop_ES', 'frontpage_teaser', '', '<i><b><font color="#0E668C" size="16">¿Qué beneficios conlleva ser Premium?</font></b></i><br><br>Una vez obtengas la suscripción Premium, podrás hacer lo siguiente:<br><br><li>Desaparecerá la publicidad del juego.</li><li>Obtendrás el doble de diamantes cada periodo de tiempo.</li><li>Obtendrás placas que acreditarán que eres Premium</li><li>Tendrás un amplio catálogo como este de rares.</li><li>¡Y muchos más beneficios que un user normal no tendrá!</li><br><i><b><font color="#0E668C" size="16">¿Dónde puedo conseguir el Premium? </font></b></i><br><br>A través de nuestra página web podrás contratar el Premium por distintos métodos. <br><br><a href="linkUrl:premium">Visita nuestra página Premium para más info.</a>', 'Coloque seu código para ser premium!', ''),
