(9, -1, 'Roupa', 1817, '1', '1', 3, '1', 'info_duckets', '', '', '', '<b><font color="#d79a33" size="16">¿No sabes que es el Armario de Ropa?</font></b><br><br>¡Es como un gran Super Mercado con todo tipo de ropa! Pero este es especial.. ¡Toda es gratis!<br><br>Con esta exclusiva ropa podrás causar tentación entre las salas de iBoom, nadie excepto otros iBooms Premiums podrán ponersela ¡serás especial! Ponte tu mejor Look y ve a darle envidia a todos tus amigos :)<br><br><b><font color="#d79a33" size="16">¿Se irán añadiendo nuevas ropas?</font></b>¡Claro que si! El armario estará en constante cambio, nuestros modistas no paran de darnos ideas para tener la mejor ropa de todo internet.', '', ''),
