(16, -1, 'Loja Ouro', 195, '1', '1', 6, 'b', 'info_loyalty', '', '', '', '<b><font color="#d79a33" size="16">¿No sabes que es la Tienda Gold?</font></b><br><br>¡Es una tienda repleta de Rares únicos y caros!<br><br>Con estos exclusivos furnis podrás crear todo tipo de salas lujosas... Casinos, Salas de apuestas, ¡e incluso un imperio! ¿Suena genial verdad? ¡Beneficios del <b>iBoom Premium</b>!<br><br><b><font color="#d79a33" size="16">¿Nunca cambiarán estos rares? </font></b><br><br>Todos estos furins cambiarán por sorpresa cada cierto tiempo asi que ¡No los pierdas de vista! Quizás cada semana.. cada 2 semanas...', '', ''),
(17, -1, 'Loja Prata', 196, '1', '1', 7, 'c', 'info_loyalty', '', '', '', '<b><font color="#8a8484" size="16">¿No sabes que es la Tienda Silver?</font></b><br><br>¡Es una tienda repleta de gama normal!<br><br>Con estos exclusivos furnis podrás crear todo tipo de salas de apuestas, de pujas, ¡e incluso una tienda! ¿Suena genial verdad? ¡Beneficios del <b>iBoom Premium</b>!<br><br><b><font color="#8a8484" size="16">¿Nunca cambiarán estos rares? </font></b><br><br>Todos estos furins cambiarán por sorpresa cada cierto tiempo asi que ¡No los pierdas de vista! Quizás cada semana.. cada 2 semanas...', '', ''),
(18, -1, 'Loja Bronze', 197, '1', '1', 8, 'd', 'info_loyalty', '', '', '', '<b><font color="#b16800" size="16">¿No sabes que es la Tienda Bronze?</font></b><br><br>¡Es una tienda repleta de rares de gama básica!<br><br>Con estos exclusivos furnis podrás darle un toque decorativo a todas tus salas ¡increible! ¿Suena genial verdad? ¡Beneficios del <b>iBoom Premium</b>!<br><br><b><font color="#b16800" size="16">¿Nunca cambiarán estos rares? </font></b><br><br>Todos estos furins cambiarán por sorpresa cada cierto tiempo asi que ¡No los pierdas de vista! Quizás cada semana.. cada 2 semanas...', '', ''),
