INSERT INTO `cms_campaigns` (`id`, `title`, `shortstory`, `image`, `author`, `time`, `link`) VALUES
(1, 'Bem-vindo', '<p>Estamos de volta, com site novo e muitas novidades.</p>', 'http://images.habbo.com/c_images/hot_campaign_images_fi/hot_campaign_button_160x60_Waving.gif', 'Wee', 1475699091, 'http://wyndhotel.com.br/index.php?url=news&id=10');
INSERT INTO `cms_hotcampaigns` (`id`, `image_url`, `caption`, `descr`, `url`, `botao`) VALUES
(2, 'http://127.0.0.1/web_promo/45mei_TopStory.gif', 'Bem vindo ao Haboo!', 'Muitas surpresas estão por vir...<br>MUAHAHAHAHAHAHA', '/client', 'Confira >'),
(3, 'http://127.0.0.1/web_promo/carnaval_topstory.gif', 'O Haboo chegou com tudo!', 'O novo hotel Haboo é o mais atualizado do<br>momento, com vários novos recursos,<br>CMS rápida e cheia de funções<br> e muitas outras coisas <?php echo $sitename; ?>', 'http://127.0.0.1/articles/56', 'Faça parte!');
