(1, 'A cms ainda não esta pronta!', '2017-02-06 00:10:16');
INSERT INTO `cms_news` (`id`, `title`, `image`, `shortstory`, `longstory`, `author`, `published`, `type`, `roomid`, `curtidas`, `updated`, `formulario`, `visitas`, `count`, `look`) VALUES
(10, 'Sejam bem-vindos!', 'http://images.habbo.com/c_images/Top_Story_Images/TopStory_habboweek_frank1.gif', 'O Wynd retornou...', '<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Seja muito bem-vindo a esta nova fase do Wynd!</span></span></p>\r\n\r\n<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Ap&oacute;s algum per&iacute;odo offline, voltamos com diversas novidades para voc&ecirc;s! Confira abaixo alguma de nossas atualiza&ccedil;&otilde;es:</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Cat&aacute;logo atualizado</span></span></strong></p>\r\n\r\n<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Como sabemos que gostam de construir quartos e desenvolver sua imagina&ccedil;&atilde;o, adicionamos mobis incr&iacute;veis para decorar e construir diversos tipos de quartos!</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style="font-family:arial,helvetica,sans-serif; font-size:14px">Sistema de Talentos</span></strong></p>\r\n\r\n<p><span style="font-family:arial,helvetica,sans-serif; font-size:14px">Ao completar o sistema de talentos, voc&ecirc; ganha acesso a ferramenta de guardi&atilde;o, para atender chamados de usu&aacute;rios com algum problema no jogo!</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style="font-family:arial,helvetica,sans-serif; font-size:14px">C&acirc;mera 100%</span></strong></p>\r\n\r\n<p><span style="font-family:arial,helvetica,sans-serif; font-size:14px">Agora voc&ecirc; pode tirar fotos dentro do jogo, colocar em seu quarto e mostrar para todos como &eacute;s bonito/bonita!</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style="font-family:arial,helvetica,sans-serif; font-size:14px">R&aacute;dio</span></strong></p>\r\n\r\n<p><span style="font-family:arial,helvetica,sans-serif; font-size:14px">Como o de costume, voc&ecirc; pode ouvir suas m&uacute;sicas preferidas em nossa r&aacute;dio, al&eacute;m de interagir com nossos locutores!</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">CMS Interativa</span></span></strong></p>\r\n\r\n<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Al&eacute;m das atualiza&ccedil;&otilde;es dentro do jogo, colocamos tamb&eacute;m uma nova CMS, com diversos sistemas bacanas e que valem a pena conferir!</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><span style="font-family:arial,helvetica,sans-serif; font-size:14px">Vagas na Equipe</span></strong></p>\r\n\r\n<p><span style="font-family:arial,helvetica,sans-serif; font-size:14px">Como de costume, estamos abrindo vagas em nossa equipe, realize o formul&aacute;rio e aguarde o resultado!&nbsp;</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href="https://docs.google.com/forms/d/e/1FAIpQLSe4dY4gou9krV74DBFMC_DsAlhre2vhuzU6-zZOvKCwWA_o1Q/viewform?usp=sf_link" target="_blank"><span style="color:#ff0000"><u><em><strong><span style="font-family:arial,helvetica,sans-serif; font-size:14px">FORMUL&Aacute;RIO</span></strong></em></u></span></a></p>\r\n', 'Wee', 1512485946, '1', '1', '0', '0', 0, 0, 1, 'ha-6058508-62.hr-802-37.hd-185-1.wa-2001-0.lg-280-73.ch-804-82.sh-3068-1408-1408'),
(12, 'PROMO1', 'http://wyndhotel.com.br/app/tpl/skins/Habbo/topstory_files/ts_gondola.png', 'PROMO1', '<p>TESTE</p>\r\n', 'Wee', 1513119255, '1', '1', '0', '0', 0, 1, 1, '');
