INSERT INTO `moderation_presets` (`id`, `enabled`, `type`, `message`) VALUES
(1, '1', 'message', 'Acreditamos que o seu comportamento não seguir as regras do hotel. Por favor, alterá-lo, ou você pode ser punido.'),
(2, '1', 'message', 'Nós queremos que você esteja em segurança no hotel. Portanto, recomendamos que você não dê ou pedir informações pessoais para usuários desconhecidos.'),
(3, '1', 'message', 'Não incista outras pessoas para executar conteúdo sexual dentro do hotel! Você pode ser banido.'),
(4, '1', 'message', 'Não floode o quarto! Você pode ser expulso/banido do quarto. ou mesmo ser banido do hotel.'),
(5, '1', 'roommessage', 'Mmm talvez o tema deste quarto é interessante para um outro local que lito, você não acha? Eu tenho que fechá-lo e tirar as pessoas daqui.'),
(6, '1', 'roommessage', 'Mmm esta sala no es de confianza... se esta cometiendo un timo, recuerda pensar antes de apostar tus rares con otros usuarios, debo cerrar la sala y echaros de aquí.'),
(7, '1', 'roommessage', '¡Vaya! Parece que nos ha surgido un imprevisto en la sala... volveremos lo antes posible '),
(8, '1', 'message', '¡Tu comportamiento da mucho que desear! Por favor, respeta las normas de iBoom o serás sancionado.'),
(9, '1', 'message', '¡Eh! Estas bloqueando una casilla, no te quedes ausente en lugares donde la gente quiera pasar o podrías ser kickeado de la sala.'),
(10, '1', 'roommessage', 'El nombre de la sala es obsceno y ofensivo. Decidimos cambiarlo por uno más adecuado.'),
(11, '1', 'message', 'Tu actitud puede resultar molesta para algunos usuarios. Por favor modérate o serás muteado/a.'),
(12, '1', 'message', 'Lo sentimos. El nombre de usuario que estás usando es inapropiado. En breve serás baneado, por favor create otro usuario y sigue disfrutando de iBoom.'),
(13, '1', 'message', 'No copies look''s a personas que no conoces. Tal vez se molesten por que lo hagas así que ¡pregúntales primero antes de hacerlo!'),
(14, '1', 'roommessage', 'Esta sala no cumple con la normativa de iBoom, por ello procedemos a cerrarla y echar a todos los usuarios de la sala.'),
(15, '1', 'roommessage', '¡Si ves publicistas de otro hotel reporta para que un staff los eche de iBoom!'),
(16, '1', 'message', '¡Eh! No nombres otros hoteles podrías ser banead@ por un Moderador');
